const initialState = {
  identification: {
    version: "0.0.1",
    productionPath: "production",
    agent: "desktop",
  },
};
const config = (state = initialState, { type, payload }) => {
  switch (type) {
    case "@config/SET_AGENT":
      return {
        ...state,
        identification: {
          ...state.identification,
          agent: payload,
        },
      };
    default:
      return state;
  }
};
export default config;
